import React from "react";
import ReactEcharts from 'echarts-for-react';

export default class TicketTypes extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
           
        };
    }
  getOption = () => {
	let op = {
			width: '30%',
			series: [
				{
					color: ['rgba(0,0,0,0)','#0066FF'],
					type:'pie',
					radius: ['20%', '20%'],
					avoidLabelOverlap: false,
					label: {
						normal: {
							show: false,
						}
					},
					labelLine: {
						normal: {
							show: false
						}
					},
					data:[
						{value:1000-333},
						{value:333}
						
					]
				},
				{	
					color: ['rgba(0,0,0,0)','#0099FF'],
					type:'pie',
					radius: ['20%', '30%'],
					avoidLabelOverlap: false,
					label: {
						normal: {
							show: false,
						}
					},
					labelLine: {
						normal: {
							show: false
						}
					},
					data:[
						{value:1000-555},
						{value:555}
						
					]
				},
				{	
					color: ['rgba(0,0,0,0)','#00FFFF'],
					type:'pie',
					radius: ['20%', '30%'],
					avoidLabelOverlap: false,
					label: {
						normal: {
							show: false,
						}
					},
					labelLine: {
						normal: {
							show: false
						}
					},
					data:[
						{value:1000-888},
						{value:888}
						
					]
				}
			]
		}
		return op;		
	}
    render() {
        return (
			<ReactEcharts option={this.getOption()} style={{height:'100%',width:'100%'}}></ReactEcharts>
        )
    }
}
